import "./Destination.css"

export default function Destination() {
    return (
    <div className='destination'>
        <h1>Name Pricipal</h1>
        <h2>Principal</h2>
        <p>
            The concept of in Maha Upanishad beautifully
        </p>
    </div>
    )
}
